import React from "react";
import Navbar from "../navbar";
import { isAuth } from "./helpers";
import LandingPage from "./landingPage";

 

function home() {
    return <div> 

    <Navbar />
    {isAuth()?    <h1>Real home</h1>: <LandingPage/> }


    
     </div>

}

export default home;
